import React from 'react';
import {Link} from 'react-router-dom';

const Register = () => {
    return (
        <div className='register'>
            <h3>Create an account</h3>
            <form>
                <label htmlFor='email'>email address: </label>
                <input type='text' id='email' name='email' />
                <label htmlFor='regpwd'>password: </label>
                <input type='password' id='regpwd' name='regpwd' />
                <label htmlFor='regpwd'>(Create a password at least 8 characters long, including uppercase and lowercase letters, numbers, and a special character (e.g., $ ! @ #).</label>
            </form>
            <p>Click <Link to='account/login'>here</Link> to log in.</p>
        </div>
    );
}

export default Register;
